import React from 'react';
import './DescriptionBox.css';

const DescriptionBox = () => {
  return (
    <div className='descriptionbox'>
      <div className="descriptionbox-navigator">
        <div className="description-nav-box">Description</div>
        <div className="description-nav-box fade">Reviews (122)</div>
      </div>

      <div className="decriptionbox-description">
        <p>
        An e-commerce website is an online platform thet facilitate buying and selling of products or services over the internet serves as a vitual marketplace where businesses and induvidual showcase their products, interect with customers, and conduct transactions without the need for a physical presence. E-commerce website have gained immense popularity due to their convenient accessibility, and the global reach they offer.
        </p>
      </div>
    </div>
  )
}

export default DescriptionBox
